var title_f32_10_32940="Rx GI disorders in scleroderma";
var content_f32_10_32940=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RHEUM%2F64498&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RHEUM%2F64498&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Management of GI involvement in systemic sclerosis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Site",
"       </td>",
"       <td class=\"subtitle1\">",
"        Disorder",
"       </td>",
"       <td class=\"subtitle1\">",
"        Treatment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        Mouth",
"       </td>",
"       <td>",
"        Tight skin",
"       </td>",
"       <td>",
"        Facial exercises",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Dental caries",
"       </td>",
"       <td>",
"        Dental treatment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sicca syndrome",
"       </td>",
"       <td>",
"        Artificial saliva",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"3\">",
"        Esophagus",
"       </td>",
"       <td>",
"        Hypomotility",
"       </td>",
"       <td>",
"        Cisapride, avoid NSAIDS and nifedipine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Reflux esophagitis",
"       </td>",
"       <td>",
"        Proton pump inhibitors (omeprazole, lansopazole), bed elevation, no late meals, metoclopramide",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Stricture",
"       </td>",
"       <td>",
"        Dilatation, omeprazole",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Stomach",
"       </td>",
"       <td>",
"        Gastric paresis",
"       </td>",
"       <td>",
"        Cisapride, metoclopramide",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"5\">",
"        Small bowel",
"       </td>",
"       <td>",
"        Hypomotility",
"       </td>",
"       <td>",
"        Rotational antibiotics*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Stasis",
"       </td>",
"       <td>",
"        Cisapride&bull;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Bacterial overgrowth",
"       </td>",
"       <td>",
"        Metoclopramide&bull;, pancreatic supplements, octreotide (low dose), enteral and parenteral nutritional support",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pseudo-obstruction",
"       </td>",
"       <td>",
"        Conservative management \"drip and suck\"",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pneumatosis intestinalis",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"3\">",
"        Large bowel",
"       </td>",
"       <td>",
"        Hypomotility",
"       </td>",
"       <td>",
"        Dietary manipulation, cisapride may help, stool expanders (eg, ispaghula)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Colonic pseudodiverticula",
"       </td>",
"       <td>",
"        (Resection)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pseudo-obstruction",
"       </td>",
"       <td>",
"        Conservative management \"drip and suck\"",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Anus",
"       </td>",
"       <td>",
"        Sphincter involvement",
"       </td>",
"       <td>",
"        Stimulation, surgery",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Useful antibiotics: ciprofloxacin, amoxicillin, metronidazole, oral vancomycin, trimethoprim. Change of antibiotics every 4 weeks with occasional \"antibiotic holiday\" may reduce development of resistant strains.",
"     <br>",
"      <span class=\"bullet\">",
"       &bull;",
"      </span>",
"      Prokinetic drugs only useful in early neuropathic disease; these drugs are not useful later when smooth muscle is destroyed.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
